import Home from "./views/Home.jsx";
import Explore from "./views/Explore.jsx";
import Blog from "./views/Blog.jsx";
import SmartChef from "./views/SmartChef.jsx";
import PostRecipe from "./views/PostRecipe.jsx";
import Profile from "./views/Profile.jsx";
import RecipeDetail from "./views/RecipeDetail.jsx";
import Layout from "./components/Layout.jsx";
import { BrowserRouter, Route, Routes } from "react-router-dom";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route element={<Layout />}>
          <Route index element={<Home />} />
          <Route path="explore" element={<Explore />} />
          <Route path="blog" element={<Blog />} />
          <Route path="smart-chef" element={<SmartChef />} />
          <Route path="post" element={<PostRecipe />} />
          <Route path="profile" element={<Profile />} />
          <Route path="recipe/:id" element={<RecipeDetail />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
